    false,nt"url": null,nt"notes": "NODC Accession 0115260 includes profile,
    discrete sample and chemical data collected aboard the ALPHA HELIX and WECOMA during
    cruises HX203, HX205, HX208, HX211, HX215, HX216, HX217, HX218, HX219, HX223, HX225,
    HX226, HX228, HX230, HX231, HX234, HX237, HX238, HX239, HX241, HX243, HX246, HX248,
    HX252, HX253, HX254, HX257, HX258, HX262, HX263, HX267, HX268, HX269, HX270, HX272,
    HX276, HX279, HX280, HX283, HX286 and W0307A in the Gulf of Alaska from 1998-03-08
    to 2004-07-05. These data include NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE,
    NITRITE, SILICATE, AMMONIUM and NITRATE. The instruments used to collect these data
    include bottle. These data were collected by Terry E. Whitledge of University of
    Alaska Fairbanks as part of NEP. The Biological and Chemical Oceanography Data Management
    Office (BCO-DMO) submitted these data to NODC on 2013-09-28.nnThe following is the
